import { connect } from "react-redux";
import JDBuildingHeader from "./component";
import {
    pathChangeHandler
} from "../actions";
import ls from "local-storage";

const mapStateToProps = state => ({
    headerLinks: state.JDBUILDING.data.headerLinks,
    headerPath: state.JDBUILDING.data.activePath,
    title: ls.get('jobTitle')  ? ls.get('jobTitle') : state.JOBOPENING.forms.jobOpeningForm.fields.jobTitleField.placeholder
})

const mapDispatchToProps = (dispatch, props) => ({
    pathChangeHandler: (value) => {
        dispatch(pathChangeHandler(value));
    }
})

const mergeProps = (stateProps, dispatchProps, ownProps) => ({
    ...stateProps,
    ...dispatchProps,
    ...ownProps,
})

export default connect(
    mapStateToProps,
    mapDispatchToProps,
    mergeProps
)(JDBuildingHeader);
